import React from 'react';
import './dashboard.css'

const DashBoard = () => {
    return (
        <div className="dashWrapper">
            <div className="sideNavHolder subWrapper">
                <div className="cessiniHolder  subWrapper"></div>
                <div className="contentHolder  subWrapper"></div>
            </div>
            <div className="dashBody      subWrapper">
                <div className="topNav  subWrapper"></div>
                <div className="dashBodyMain  subWrapper"></div>
            </div>
        </div>
    );
}

export default DashBoard;
